import React from "react";
import TextField from "@material-ui/core/TextField";

const SignUp = () => {
  return (
    <div>
      <h2>Sign Up</h2>
      <form>
        <label>First Name</label>
        <TextField
          required
          id="outlined-required"
          label="Required"
          defaultValue="Hello World"
          variant="outlined"
        />
      </form>
    </div>
  );
};
export default SignUp;
